    def parse_hours(hours_str):
        parsed_hours = {}
        days_hours = hours_str.split(', ')
        for day_hour in days_hours:
            (day, time) = day_hour.split(': ')
            parsed_hours[day] = time
        return parsed_hours
    properties['hours'] = parse_hours(row['']['Hours of operations'])
    return properties

